import CompanyCard from "../../components/ui/CatalogCard/CompanyCard";
import { ICard, Cards } from "./cards";
import { Container, Title, Wrap } from "./styled";

export default function Home() {
  const cards = Cards.map((card) => (
    <CompanyCard imgUrl={card.imgUrl} title={card.title} />
  ));

  return (
    <Wrap>
      <Title>Каталог компаний</Title>
      <Container>{cards}</Container>
    </Wrap>
  );
}
